import CreateQuestion from "@/views/qna/CreateQuestion.vue";
import QnaList from "@/views/qna/QnAList.vue"

export const qnaRouter = [
    {
        path: '/qna/create',
        name: 'CreateQuestion',
        component: CreateQuestion
    },
    {
        path: '/qna/list',
        name: 'QnaList',
        component: QnaLust
    }
]
